import React from "react";
import {
  AuthenticationActionTypes,
  useAuthentication,
} from "../../../../context/authentication/Authentication.context";

const LogoutButton = () => {
  const [_, dispatch] = useAuthentication();
  return (
    <button
      onClick={() => dispatch({ type: AuthenticationActionTypes.logout })}
    >
      Logout
    </button>
  );
};

export { LogoutButton };
